import React, { useEffect, useRef, useState } from "react";
import {
	AreaChart,
	Area,
	XAxis,
	YAxis,
	Label,
	ReferenceLine,
	Tooltip

  } from "recharts";

function Momentum(props) {
	const [chartDimensions, setChartDimensions] = useState({ width: 800, height: 200 });
	const chartContainerRef = useRef(null);

	useEffect(() => {
		const updateDimensions = () => {
		if (chartContainerRef.current) {
			const { width, height } = chartContainerRef.current.getBoundingClientRect();
			setChartDimensions({ width, height });
		}
		};

		window.addEventListener("resize", updateDimensions);
		updateDimensions();
		return () => {
			window.removeEventListener("resize", updateDimensions);
		};
	}, [props.data]);

	const data = props.data?.content?.momentum?.main?.data;
	console.log(data);

	let minutes = [];
	let values = [];

	data?.map((moment, index) => {
		minutes.push(moment.minute);
		values.push(moment.value);
	});

	const CustomLabel = (props) => {
		const {value} = props;

		return (<text style={{ backgroundColor: "#fff", borderRadius: "999px", color:"#000", fontWeight: 500 }} >{value}</text>)

	  }

	const gradientOffset = () => {
	const dataMax = Math.max(...values);
	const dataMin = Math.min(...values);

	if (dataMax <= 0) {
		return 0;
	}
	if (dataMin >= 0) {
		return 1;
	}

	return dataMax / (dataMax - dataMin);
	};

	const off = gradientOffset();

	return (
		<div className="w-full flex flex-col rounded-lg py-4 bg-white brd gap-4">
		<div className="text-center font-medium text-base px-4">Match Momentum</div>
		<div className="brd05"></div>
		<div className="h-32 md:h-64 relative" ref={chartContainerRef}>
			<AreaChart
			width={chartDimensions.width}
			height={chartDimensions.height}
			data={values}
			margin={{
				top: 0,
				right: 40,
				left: 0,
				bottom: 0,
			}}
			>
			<XAxis
				stroke="#e8e8e8"
				strokeWidth={4}
				strokeDasharray="0.0001, 9.85704"
				strokeLinecap="round"
				tick={false}
			/>
			<YAxis />
			<ReferenceLine x={45}
				stroke="#e8e8e8"
				strokeWidth={4}
				strokeDasharray="0.0001, 9.85704"
				strokeLinecap="round"
				label={{ position: "bottom",  value: "HT", fill: "#000", fontSize: 14, offset: -5 }}
			/>
			<ReferenceLine x={0}
				stroke="#fff"
				strokeWidth={0}
				label={
					// position: "bottom",
					// value: "0'", 
					// fill: "#000", 
					// fontSize: 14, 
					// offset: -5, 
					// style={{backgroundColor: "#fff", borderRadius: 999px}} 
					<CustomLabel value="0'" fill={'white'} />
				}
			/>
			<ReferenceLine x={90}
				stroke="#fff"
				strokeWidth={0}
				label={{ position: "bottom",  value: "FT", fill: "#000", fontSize: 14, offset: -5 }}
			/>
			<defs>
				<linearGradient id="splitColor" x1="0" y1="0" x2="0" y2="1">
				<stop offset={off} stopColor={props.colorData?.home} stopOpacity={1} />
				<stop offset={off} stopColor={props.colorData?.away} stopOpacity={1} />
				</linearGradient>
			</defs>
			<Area type="monotone" dataKey="uv" stroke="#000" fill="url(#splitColor)" />
			</AreaChart>
		</div>
		</div>
	);
}

export default Momentum;
